    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT + CAST ( - col2 AS INTEGER ) * - 44 NOT BETWEEN + col0 * + + col1 + col0 + - col1 + + col1 * + col2 * col0 AND NULL;
  - name: tab2

outputs:
  - name: q10760.out
    data: |
